import { 
    Container,
    Card,
    CardBody,
    Text
 } from "@chakra-ui/react"

export default function TemperatureContainer() {
    return (
        <>
                <Card maxW="100%" m={6}>
                    <CardBody>
                        <Text>Temperature</Text>
                    </CardBody>
                </Card>
        </>
    )
}
